function consultaIntervaloImagenes(){
	var intervalo =	setInterval(function(){
		cosultaRecepcionImagenes(intervalo);
		},30000)
}

function cosultaRecepcionImagenes(intervalo){
	numeroIntentos++;
	console.log(numeroIntentos);
	$.ajax({
		url : 'consultarRecepcionImagenes.do',
		type : "GET",
		contentType : 'application/json',
		dataType: 'json',
		data : {
			folioPadre : FOLIOPADRE,
			cvProceso : SERVICIO,
			estatus : "1"
		}
	}).success(function(recepcion) {
		if(recepcion != null){
			clearInterval(intervalo);
			recuperarFirmas(recepcion);
		}else{
			if(numeroIntentos == Number(INTENTOS)){
				clearInterval(intervalo);
				window.location.href = "#";
				var tituloModal = "<h2 class='ModalTitle' >Solicitud</h2>";
				var mensajeModal = "Aun no se han encontrado archivos Â¿Desea continuar con el tramite?";
				$('#tituloActExp').empty();
				$('#mensajeActExp').empty();
				$('#tituloActExp').append(tituloModal);
				$('#mensajeActExp').append(mensajeModal);
				$('#botonesModalActExp').show();
				window.location.href = "#modalActExp";
			}
		}
	})
}

function terminarProceso(){
	$.ajax({
		url : 'terminarFolio.do',
		type : "GET",
		contentType : 'application/json',
		dataType: 'json',
		data : {
			idFolio : IDFOLIO_HIJO,
			estatus : "2"
		}
	}).success(function(resultado) {
		$(location).attr('href', 'datosGenerales.do');
	})
}

function redireccionModal(){
	window.location.href = "datosGenerales.do";
}

function recuperarFirmas(recepcion){
	var data = JSON.stringify({
		idRecepcionImagenes : recepcion.idRecepcionImagenes,
		folioProcesar : recepcion.folioProcesar,
		claveTipoProceso : recepcion.claveTipoProceso,
		numeroTotalDoctos : recepcion.numeroTotalDoctos,
		numeroTotalRecibidos : recepcion.numeroTotalRecibidos,
		fechaRecepcion : recepcion.fechaRecepcion,
		estatus : recepcion.estatus,
		fechaControl : recepcion.fechaControl,
		usuarioModificador : recepcion.usuarioModificador,
		detalleRecepcionImagen : recepcion.detalleRecepcionImagen
	});
	$.ajax({
		url : 'recuperarFirmasPdf.do',
		type : "POST",
		contentType : 'application/json',
		dataType: 'json',
		data : data,
		beforeSend : function() {
			window.location.href = "#modalLoader";
		}
	}).success(function(respuesta) {
		if(respuesta != null){
			if(respuesta.mensaje != null){
				var tituloModal = "<h2 class='ModalTitle' >Solicitud</h2><a href='#' class='ModalButton' id='btnActExp' onclick='redireccionModal()'>X</a>";
				var mensajeModal = "Ha ocurrido un problema al recibir datos de la solicitud";
				$('#tituloActExp').empty();
				$('#mensajeActExp').empty();
				$('#tituloActExp').append(tituloModal);
				$('#mensajeActExp').append(mensajeModal);
				window.location.href = "#modalActExp";
			}else{
				numeroArchivos = respuesta.numeroArchivos;
				firmaAgente = respuesta.firmaAgente;
				firmaTrabajador = respuesta.firmaTrabajador;
				generarPdfSolicitudModificacionDeDatos();				
				$("#btnSolicitarFirmas").css("display", "none");
				$("#btnContinuar").css("display", "block");
				
			}
		}
	})
}

if(AFORE != "530"){
	function SignInicio(signValue) {
		valorSign = signValue;
		var canvasObj = document.getElementById('cnv');
		canvasObj.getContext('2d').clearRect(0, 0, canvasObj.width, canvasObj.height);
		imgWidth = canvasObj.width;
		imgHeight = canvasObj.height;
		var message = { "firstName": "", "lastName": "", "eMail": "", "location": "", "imageFormat": 1, "imageX": imgWidth, "imageY": imgHeight, "imageTransparency": false, "imageScaling": false, "maxUpScalePercent": 0.0, "rawDataFormat": "ENC", "minSigPoints": 25, "penThickness": 3, "penColor": "#000000" };
		
		document.addEventListener('SigCaptureWeb_SignResponse', SigRespondeInicio, false);
		var messageData = JSON.stringify(message);
		var element = document.createElement("SigCaptureWeb_ExtnDataElem");
		element.setAttribute("SigCaptureWeb_MsgAttribute", messageData);
		document.documentElement.appendChild(element);
		var evt = document.createEvent("Events");
		evt.initEvent("SigCaptureWeb_SignStartEvent", true, false);
		element.dispatchEvent(evt);
	}
	
	function SigRespondeInicio(event) {
		var str = event.target.getAttribute("SigCaptureWeb_msgAttri");
		var obj = JSON.parse(str);
		obtieneDatos(obj, imgWidth, imgHeight);
	}
	
	function obtieneDatos(objResponse, imageWidth, imageHeight) {
		var obj = JSON.parse(JSON.stringify(objResponse));
		var ctx = document.getElementById('cnv').getContext('2d');
		var canvasObj = document.getElementById('cnv');
		
		if (obj.errorMsg != null && obj.errorMsg!="" && obj.errorMsg!="undefined") {
			
		} else {
			if (obj.isSigned) {
				var child = document.documentElement.lastChild;
				while (child.localName.includes('sigcaptureweb')) {
					document.documentElement.removeChild(child);
					child = document.documentElement.lastChild;
				}
				
				if(valorSign == 1) {
					firmaAgente = "";
					firmaTrabajador = obj.imageData;
					generarPdfSolicitudModificacionDeDatos();
					$("#btnFirmarTrabajador").css("display", "none");
					$("#btnAgenteFirma").css("display", "block");
				}else if (valorSign == 2){
					firmaAgente = obj.imageData;
					generarPdfSolicitudModificacionDeDatos();
					$("#btnAgenteFirma").css("display", "none");
					$("#btnContinuar").css("display", "block");
				}
			}		
				
		}
	}
}

